import { FC } from 'react'
import * as React from 'react'
import MemberItem from '../MemberItem/MemberItem'

import styles from './memberList.module.scss'

interface IChatMemberList {
  members: {
    is_online: boolean
    name: string
    uuid: string
  }[]
  me: {
    is_online: boolean
    name: string
    uuid: string
  }
}

const MemberList: FC<IChatMemberList> = ({ members, me }) => {
  const memberList = members.map(member => <MemberItem key={member.uuid} member={member} me={me} />)

  return <section className={styles.memberList}>{memberList}</section>
}

export default MemberList
